	"print_css": "@media screen {\n\t.print-format-gutter {\n\t\tbackground-color: #ddd;\n\t\tpadding: 15px 0px;\n\t}\n\t.print-format {\n\t\tbackground-color: white;\n\t\tbox-shadow: 0px 0px 9px rgba(0,0,0,0.5);\n\t\tmax-width: 8.3in;\n\t\tmin-height: 11.69in;\n\t\tpadding: 0.75in;\n\t    margin: auto;\n\t}\n\n\t.print-format.landscape {\n\t\tmax-width: 11.69in;\n\t\tpadding: 0.2in;\n\t}\n\n\t.page-break {\n\t\tpadding: 30px 0px;\n\t\tborder-bottom: 1px dashed #888;\n\t}\n\n\t.page-break:first-child {\n\t\tpadding-top: 0px;\n\t}\n\n\t.page-break:last-child {\n\t\tborder-bottom: 0px;\n\t}\n\n\t/* mozilla hack for images in table */\n\tbody:last-child .print-format td img {\n\t\twidth: 100% !important;\n\t}\n\n\t@media(max-width: 767px) {\n\t\t.print-format {\n\t\t\tpadding: 0.2in;\n\t\t}\n\t}\n}\n\n@media print {\n\t.print-format p {\n\t\tmargin-left: 1px;\n\t\tmargin-right: 1px;\n\t}\n}\n\n.data-field {\n\tmargin-top: 5px;\n\tmargin-bottom: 5px;\n}\n\n.data-field .value {\n\tword-wrap: break-word;\n}\n\n.important .value {\n\tfont-size: 120%;\n\tfont-weight: bold;\n}\n\n.important label {\n\tline-height: 1.8;\n\tmargin: 0px;\n}\n\n.table {\n\tmargin: 20px 0px;\n}\n\n.square-image {\n\twidth: 100%;\n\theight: 0;\n\tpadding: 50% 0;\n\tbackground-size: contain;\n\t/*background-size: cover;*/\n\tbackground-repeat: no-repeat !important;\n\tbackground-position: center center;\n\tborder-radius: 4px;\n}\n\n.print-item-image {\n\tobject-fit: contain;\n}\n\n.pdf-variables,\n.pdf-variable,\n.visible-pdf {\n\tdisplay: none !important;\n}\n\n.print-format {\n\tfont-size: 9pt;\n\tfont-family: \"Helvetica Neue\", Helvetica, Arial, \"Open Sans\", sans-serif;\n\t-webkit-print-color-adjust:exact;\n}\n\n.page-break {\n\tpage-break-after: always;\n}\n\n.print-heading {\n\tborder-bottom: 1px solid #aaa;\n\tmargin-bottom: 10px;\n}\n\n.print-heading h2 {\n\tmargin: 0px;\n}\n.print-heading h4 {\n\tmargin-top: 5px;\n}\n\ntable.no-border, table.no-border td {\n\tborder: 0px;\n}\n\n.print-format label {\n\t/* wkhtmltopdf breaks label into multiple lines when it is inline-block */\n\tdisplay: block;\n}\n\n.print-format img {\n\tmax-width: 100%;\n}\n\n.print-format table td > .primary:first-child {\n\tfont-weight: bold;\n}\n\n.print-format td, .print-format th {\n\tvertical-align: top !important;\n\tpadding: 6px !important;\n}\n\n.print-format p {\n\tmargin: 3px 0px 3px;\n}\n\ntable td div {\n\t\n\t/* needed to avoid partial cutting of text between page break in wkhtmltopdf */\n\tpage-break-inside: avoid !important;\n\t\n}\n\n/* hack for webkit specific browser */\n@media (-webkit-min-device-pixel-ratio:0) {\n\tthead, tfoot { display: table-row-group; }\n}\n\n[document-status] {\n\tmargin-bottom: 5mm;\n}\n\n.signature-img {\n\tbackground: #fff;\n\tborder-radius: 3px;\n\tmargin-top: 5px;\n\tmax-height: 150px;\n}\n\n.print-heading {\n\ttext-align: right;\n\ttext-transform: uppercase;\n\tcolor: #666;\n\tpadding-bottom: 20px;\n\tmargin-bottom: 20px;\n\tborder-bottom: 1px solid #d1d8dd;\n}\n\n.print-heading h2 {\n\tfont-size: 24px;\n}\n\n.print-format th {\n\tbackground-color: #eee !important;\n\tborder-bottom: 0px !important;\n}\n\n/* modern format: for-test */",
