function get_desktop_icons() {

	return frappe.get_apps()
		.map(app => {
			const desktop_json_path = path.resolve('apps', app, app, 'config', 'desktop.json');
			if (fs.existsSync(desktop_json_path)) {
				const desktop_json = JSON.parse(fs.readFileSync(desktop_json_path));
				return desktop_json;
			}
			return [];
		})
		.reduce((acc, curr) => {
			return acc.concat(curr);
		}, []);
}

function get_boot() {
	return new Promise(res => {
		res(boot);
	});
}

module.exports = {
	get_boot,
	get_desktop_icons
};